import React from 'react';

import style from './Style.css';
import Card from './Card';

class ProblemLevel extends React.Component {
    render(){
        return(
            <div className="section">
            <div className="hero">
                <div className="cont">
                    <h1>Choose Your Prefered Level</h1>

                </div>
            </div>
            <div className="cards">
                <Card title={'Basic level'}/>
                <Card title={'Intermediate level'}/>
                <Card title={'Advance level'}/>
            </div>
            </div>
        )
    }
}

export default ProblemLevel;
